import React from 'react';
import ReactDOM from 'react-dom';

const Table = () => {

    const data = [
        ['cell1', 'cell2', 'cell3', 'cell4'],
        ['cell1', 'cell2', 'cell3', 'cell4'],
        ['cell1', 'cell2', 'cell3', 'cell4'],
        ['cell1', 'cell2', 'cell3', 'cell4'],
    ];
     

    return (
        <table>
            <tr>
                <th>{ data[0] }</th>
                <th>{ data[1] }</th>
                <th>{ data[2] }</th>
            </tr>
            <tr>
                <td>Jill</td>
                <td>Smith</td>
                <td>50</td>
            </tr>
            <tr>
                <td>Eve</td>
                <td>Jackson</td>
                <td>94</td>
            </tr>
        </table>
    );
};

const TableHeader = () => {
    return <h1>My Table</h1>;
};

const App = () => {
    return (
        <div>
        <TableHeader />
        <Table />
    </div>
    );
};

ReactDOM.render(<App />, document.getElementById('root'));
